INSERT INTO `Comment` VALUES (144,'Overall a great teacher. He had great response time to emails, was easy to talk to, and overall cared about the students grades and time. I learned a lot and I hope to have Dr.Drott again.','2011-07-26','Winter','2009',1,273,1286,0,1,0),(148,'Karol really seems to care about students. He was in no means an \"easy\" teacher, but he made class fun and even took the class outside on a few occasions. His industry knowledge helps you to learn more than just the theory.','2011-07-26','Fall','2010',1,290,2440,0,2,0),(149,'This course was way easy! I\\\'d totally take it again. Try to take Drott if you can.','2011-08-20','Summer','2003',2,273,1286,0,0,0),(153,'Very easy professor! While, he does not respond to emails quickly, if at all, he grades easy, does not give hard midterms, and is attentive to your needs inside the classroom.','2011-08-21','Spring','2010',2,300,1293,0,0,0),(154,'Overall, a quick and easy course on software engineering! TJ read mainly off slides and let us out an hour early! Want an easy A? Take TJ!','2011-08-21','Summer','2011',1,300,1295,0,0,0),(155,'Dr. Du was one of the easiest teachers I\'ve had for class. He didn\'t seem like he wanted to teach the class for the full length at night. His quizzes were pretty easy, the midterm was a joke, all we learned about was basic php which we already had learned about in 151. Easy A!','2011-08-21','Spring','2011',2,272,1293,0,0,0),(156,'This was one of my first classes at Drexel. She was very helpful and attentive to students needs. As long as you showed your willingness to try to learn material she would help you through. I would take her again!','2011-08-24','Fall','2009',1,291,2593,0,0,0),(157,'She wasn\'t the most charming person, if a student arrived just one time a few minutes late she would call them out in class and refuse to let them in the class. Her homework assignments and in class exercises were fair and beneficial. I would take her again!','2011-08-24','Winter','2010',2,307,2780,0,0,0),(158,'A soft-spoken woman, she is really considerate and understanding if you have any course questions. She will also gladly proofread and help you revise all three of the term papers that you have to write for this class! She gives extra credit if you go to the writing center to work on your homework with her.','2011-08-24','Winter','2010',1,308,912,0,0,0),(159,'Expect to read a lot of short stories in this class! Kotzin makes you read about 3 per week, but you usually can get away with reading one or two if you understand a few pretty well. Expect a few quizzes throughout, but if you have any questions she is more than happy to help.','2011-08-24','Spring','2010',1,305,913,0,0,0),(160,'Definitely one of the more easier, but thought provoking professors at Drexel. Expect a weekly quiz (about 20 questions each) and a midterm and final. The good part is: all grading is done online, so if you miss class you can read the powerpoints and then take the quiz for the week. ','2011-08-24','Fall','2010',1,315,2196,0,0,0),(161,'This class was very easy! Since it was spring term, Steven only made us  have class for an hour or so. We had two tests, both of which he basically told us exactly what to study. He responded to emails quickly if you had any and generally was a great teacher. ','2011-08-24','Spring','2010',1,309,1286,0,0,0),(162,'This course basically teaches you the rudiments of the python programming language. Leitner showed us how to use python for command line interfaces. He was very responsive to emails.','2011-08-24','Winter','2010',1,310,1288,0,0,0),(163,'She was my adviser at the time and full of energy! This course basically practiced your presentation skills. I would recommend her!','2011-08-24','Fall','2010',1,543,1290,0,0,0),(164,'Rick was a bit daunting to take because he was a bit too upfront with students about their speaking performance. After each speech he critiqued how you did in front of the class. Even though I received an A- in the class, his teaching style was a bit discomforting.','2011-08-24','Winter','2010',2,311,311,0,0,0),(165,'Easy A, thats all there is to say. Drott is very quirky, but understands what students will and wont do. Be prepared to learn a lot.','2011-08-24','Fall','2010',1,273,1285,0,0,0),(166,'The british accent is great! He enjoys working with students, but dont get on his bad side. Be prepared to see him sipping tea everyday (especially if you have him for night class). ','2011-08-24','Winter','2009',2,312,1289,0,0,0),(167,'This class is a joke. Plan to do some html and javascript. You wont be going too much in depth though with any of it. This is primarily a user interface class, so its worthwhile in the end. TJ is pretty good despite his somewhat shrewd comments to students.','2011-08-24','Winter','2011',1,300,1292,0,0,0),(168,'If you are taking 20 credits, prepare to drop a course or two especially if math (calculus) isnt your strong point. Steuber goes out of her way to make herself available though so as long as you stick through it, you should pass with a C.','2011-08-24','Winter','2010',2,313,1656,0,0,0),(169,'Absolutely the worst professor ever at Drexel. I would never suggest taking her if  you can help it! She says if you ask questions about class or your grade then you are going to fail. She gives you a pop midterm and wonders why the whole class failed. Beware!','2011-08-24','Winter','2009',3,306,2205,0,0,0),(170,'Wall-mounted white board sheets are the keystone of this class! Learn to work in teams to design systems and then give an overview to the class. This class teaches you to think quick, while still keeping your end user in mind. Donaldson gives a midterm that is very straightforward.','2011-08-24','Winter','2010',1,312,1296,0,0,0),(171,'Boy, this guy is a brainiac ! You will learn the best methods to implement into creating, designing, and simplifying database structures. You have a midterm and final, but as long as you are fine doing the labs, the tests are similiar to the labs.','2011-08-24','Fall','2011',1,271,1299,0,0,0),(172,'Had him two quarters in a row! Very helpful in both! If I ever have  to take weather again it sure will be with House.','2011-08-24','Winter','2010',1,315,2197,0,0,0),(173,'Beware of his accent! He is very helpful if you see him during office hours since many of these sections of this course have over 100+ people in each. As long as you show him you\\\'re trying your best inside and out of the class, he will let you pass with a C. HAZ is the man!','2011-08-24','Winter','2010',2,316,2670,0,0,0),(174,'Expect to learn a lot, she isnt the easiest teacher, but she will work with you to succeed if you really want it. Expect to do a ton of reading and writing for her, but it will pay off in the end!','2011-08-24','Fall','2011',2,544,316,0,0,0),(175,'Very easy course! Students read about 10 short stories for the quarter and discuss them online. Sometimes I wondered what was the point of going to class. Drott was helpful with any technical problems.','2011-08-24','Winter','2010',1,273,1300,0,0,0),(176,'Excellent teacher! She really is not concerned with your participation as much as she is with your willingness to work in groups and keep her up-to-date with the couple projects you have to complete in this class.','2011-08-24','Winter','2011',1,317,2609,0,0,0),(177,'Another daunting STAT class for some! Merrill allows you to use a 5-page cheat sheet for the midterm and a 10-page cheat sheet for the final. He has weekly quizzes to complete online, but you can retake them as many times as you want. Best STAT 202 teacher at Drexel!','2011-08-24','Winter','2011',1,318,2671,0,0,0),(178,'Good guy! He helps if your confused on a subject, lets you hand in work late if you miss the deadline, and has a main objective of you learning.','2011-08-24','Spring','2011',1,192,1294,0,0,0),(186,'Prof Geller is super nice but a bit of a tough grader.  She usually makes you write journals for your mid-term and final which aren\'t so bad but she just wants you to be really specific and use the terminology so if you do that you should be good.','2011-08-25','Spring','2011',1,539,2447,0,0,0),(187,'Prof. DeMatteo is awesome.  He\'s really laid back and knows what he\\\'s talking about.  If you have the chance to take him for Drugs and Human Behavior DO IT because he makes the class really interesting and fun.  As for his tests they\\\'re pretty easy; just study his powerpoints and you\'ll pass no problem.  You usually have to do some reaction papers but they\'re pretty easy too and not too long; maybe 2 pages each.','2011-08-25','Winter','2011',1,536,2440,0,0,0),(188,'I found Prof. Osipowicz to humorous because he\'s a total hipster.  Besides that he\'s a pretty decent teacher.  He\\\'s super smart and sometimes I think he forgets that he\'s teaching undergrads and starts talking to us like Phd students and when we all start giving him blank stares he snaps back to reality.  He\'s overall a pretty good teacher and has a really cool hairstyle.','2011-08-25','Fall','2011',1,290,2443,0,0,0),(189,'Prof. Hammoudeh is a really really nice guy.  He\'s always willing to help you and answer any questions you may have.  His accent is hard to understand sometimes so I suggest you sit up front so you can hear him.  His tests are open note but don\'t let that stop you from studying for them because they\'re pretty difficult.','2011-08-25','Winter','2011',2,363,620,0,0,0),(190,'TJ is the man, take his courses.  You will be satisfied. He will not try to fail you as opposed to other professors. Complete the assignments and attend class and you will do well.','2011-08-25','Summer','2011',0,300,1295,0,0,0),(191,'Chute was one of the best professors I have ever had. Not only did he teach the material but he made every day interesting. Here I am 2 yrs latter and I still can recall so many things from is class. As a business student remembering elective materials is a feat in its self.','2011-08-28','Fall','2009',1,211,2419,0,0,0),(192,'This man was the worst professor ever.  He insults his students\' intelligence and makes remarks such as, \"If you don\'t understand this concept, you are not sober enough for this class.\"  The only way you will pass his class is if you you have already had all of the concepts before, or if you seek a significant amount of outside help.  Adding to his poor teaching skills, he tends to make mistakes on long (15 to 30 minute problems) and not notice until the end, further confusing the class until he studies the problem intensely for several minutes.  Adding to this, he has a tendency to make strange statements, saying things such as, \"If you don\'t understand this problem, you need to go home, take a nice hot bubble bath, and just think about math.\"  Overall, avoid this professor if you can!','2011-08-31','Spring','2011',3,597,1660,0,0,0),(193,'Difficult but you will learn a lot. I suggest only taking his classes if you have a good grasp on math.','2011-08-31','Fall','2008',1,368,621,0,0,0);
